export default function Navbar() {
  return (
    <nav className='navbar'>
        {/* <FontAwesomeIcon icon="fa-thin fa-plane-engines" /> */}
        <FontAwesomeIcon icon={solid('plane-engines')} />

        <h3>my travel blog</h3>
        </nav>
  )
}
